import React, { useState } from "react";
import {useHistory} from "react-router-dom";
import App from "./App";

function FishCard({fish, setFish}) {
  let history = useHistory()
  function fishInfo(){
  history.push('/info')
  console.log("test")
  }

  function handleHover() {
    <App style={{innerWidth: '2000px'}} />
  }
  return (
    <li onHover={handleHover} onClick = {fishInfo} className="card">
      <img src={fish["Species Illustration Photo"].src} alt={fish.name}></img>
      <h4>{fish["Species Name"]}</h4>
      <br></br>
      <p><b>Availability</b>{fish.Availability}</p> 

    </li>
  );
}

export default FishCard;
